import React from 'react'

import Title from '../Title/Title.js'
import Header from '../Header/Header.js'


function Analytics () {
    return (
        <div class='analytics'>
            <Header />
            <Title name={'Analytics'}/>
            <iframe width="560" height="315" src="https://www.youtube-nocookie.com/embed/Xc1Le3CSdrM" title="YouTube video player" frameborder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowfullscreen></iframe>
        </div> 
    )
}

export default Analytics;
